import rentCar from "../ImageIcons/Welcome/commercial-car.png";
import useCar from "../ImageIcons/Welcome/car.png";
import Card from "react-bootstrap/Card";
import { Col, Container, Row } from "react-bootstrap";
function Welcome() {
  return (
    <Container>
      <Row>
        <Col
          xs={12}
          sm={12}
          md={12}
          lg={6}
          xl={6}
          xxl={6}
          style={{
            display: "flex",
            justifyContent: "center",
          }}
        >
          <Card style={{ width: "12rem" }}>
            <Card.Img variant="top" src={rentCar} />
            <Card.Body>
              <Card.Title>Become a Host</Card.Title>
            </Card.Body>
          </Card>
        </Col>
        <Col xs={12} sm={12} md={12} lg={6} xl={6} xxl={6}>
          <Card style={{ width: "12rem" }}>
            <Card.Img variant="top" src={useCar} />
            <Card.Body>
              <Card.Title>Card Title</Card.Title>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}
export default Welcome;
